- Four freestanding buildings with car parks, service access, and two street frontage, located within the Emerald Central Business District;
- The business, the property and leased detached bottle shop are to be sold “as is” incorporating fittings, fixtures and chattels;
- Commercial Hotel Licence number 81949 and Gaming Machine Licence number 73401
- Licensed for 37 Electronic Gaming Machines, currently has 29 Operating Authorities  (transfer subject to regulatory approval);
- Fit-out includes public bar, gaming room, café, function room and commercial kitchen;
- Onsite drive through bottle shop, liquor warehouse and off site leased detached bottle shop;
- 30 existing accommodation rooms;
- Two bedroom manager’s residence;
- The Hotel operates a Detached Bottle Shop (leased) located within the Emerald Village Shopping Centre;
- 4,083sqm* land parcel (Lot 17 on  SP257983).


The Asset is offered for sale by way of Offers to Purchase.

For further information, or to arrange an inspection, please contact the Agents on the details listed.

